result:
.format-one {
  border: 1px solid #dcdfe6;
}
.format-two {
  border-right: 1px solid #dcdfe6;
  border-left: 1px solid #dcdfe6;
  border-bottom: 1px solid #dcdfe6;
  margin-bottom: 20px;
}
.textarea {
  >>> .el-textarea__inner {
    height: 300px !important;
    line-height: 30px;
  }
}
.demo-box {
  margin: 10px 0;
  border: 1px solid #d9d9d9;
  .w-220px {
    width: 220px;
  }
  .w-100px {
    width: 100px;
  }
  .demo-box-cell {
    line-height: 36px;
    border-bottom: 1px solid #d9d9d9;
    padding: 0 15px;
    &:last-child {
      border-bottom: 0;
    }
    p,
    span {
      display: inline-block;
    }
    span {
      color: #1890ff;
    }
  }
}
